import { useEffect } from "react";

export interface LoginProps {}

const token =
  "eyJhbGciOiJIUzUxMiJ9.eyJzdWIiOiJhZG1pbiIsImlhdCI6MTYxMDkxMjUxNSwiZXhwIjoxNjEwOTMwNTE1fQ.s0i8Mw9cLCUM-v23x5MmvFY3xQ-D6ofshm8D6rgLoMIZA6plvPyDjWqvDcE_rKGkxD4KnPCmkdHu_jvgpu5cUg";
const Login: React.FC<LoginProps> = () => {
  // axios.defaults.headers.common = {
  //   Authorization: "Bearer " + token,
  // };
  useEffect(() => {
    const fetch = async () => {
      try {
        const response = await axios.get("http://localhost:8080/api/v1/data", {
          headers: {
            "Content-Type": "application/json",
            Authorization: "Bearer " + token,
          },
        });
        console.log(response.data);
      } catch (error) {
        console.log(error);
      }
    };
    fetch();
  }, []);
  return <div>Login</div>;
};

export default Login;
